import "./Footer.css";
import logoFooter from "../../images/img/logo-footer.svg";
function Footer() {
  return (
    <footer>
      <div className="footer__box">
        <img src={logoFooter} alt="" />
      </div>
    </footer>
  );
}

export default Footer;
